import { render } from '@testing-library/react';
import './App.css';

class App {
   rows = [];
   objectRows = [
    { text: "Hit the gym", checked: true}, 
    { text: "Hit the gym", checked: false}
  ];


  handleClick(event){
    objectRows.push({text:document.getElementById("myInput").value, checked:false})
    App();
  } 

  render(){
    for (let i = 0; i < objectRows.length; i++) {
      rows.push(<li class={objectRows[i].checked?"checked":""} >{objectRows[i].text}</li>);
    } 
  return (
    <div className="App">
      <div className="test">
      <div id="myDIV" className="header">
        <h2>My To Do List</h2>
        <input type="text" id="myInput" placeholder="Title..." />
        <span onClick={handleClick} className="addBtn">Add</span>
      </div>
      <ul id="myUL">
        {rows}
      </ul>
      </div>
    </div>
  );
  }

}
ReactDOM.render(<App />, document.getElementById('root'));
export default App;
